import React, { useState } from 'react';
import { Card } from 'primereact/card';
import { InputText } from 'primereact/inputtext';
import { Password } from 'primereact/password';
import { Button } from 'primereact/button';
import { Message } from 'primereact/message';
import { Divider } from 'primereact/divider';
import { Checkbox } from 'primereact/checkbox';
import './App.css';

function App() {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
    rememberMe: false
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleInputChange = (field, value) => {
    setFormData(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    setTimeout(() => {
      if (formData.email && formData.password) {
        console.log('Login attempt:', formData);
        alert('Login successful! (This is a demo)');
      } else {
        setError('Please fill in all fields');
      }
      setLoading(false);
    }, 1000);
  };

  return (
    <div className="app">
      <header className="main-header">
        <div className="header-content">
          <div className="logo-area">
            <a href="https://logogramma.com" target="_blank" rel="noopener noreferrer">
              <img src="/logogramma.png" alt="Logogramma Logo" className="logo-img" />
            </a>
          </div>
          <nav className="nav-bar">
            <a href="#" className="nav-link">Artificial Intelligence</a>
            <a href="#" className="nav-link">Digital Innovation</a>
            <a href="#" className="nav-link">Use case</a>
            <a href="#" className="nav-link">Who we are</a>
            <a href="#" className="nav-link">CSR</a>
            <a href="#" className="nav-link">Internships</a>
            <a href="#" className="nav-link">Novelty</a>
          </nav>
        </div>
      </header>
      <div className="teal-bar" />
      <div className="login-container">
        <Card className="login-card">
          <div className="login-header">
            <h1>Sign in to AI.CODIUM®</h1>
            <p>Enter your credentials to access your account</p>
          </div>
          <form onSubmit={handleSubmit} className="login-form">
            {error && (
              <Message 
                severity="error" 
                text={error} 
                className="error-message"
              />
            )}
            <div className="field">
              <label htmlFor="email" className="field-label">
                Email Address
              </label>
              <InputText
                id="email"
                type="email"
                value={formData.email}
                onChange={(e) => handleInputChange('email', e.target.value)}
                placeholder="Enter your email"
                className="w-full"
                required
              />
            </div>
            <div className="field">
              <label htmlFor="password" className="field-label">
                Password
              </label>
              <Password
                id="password"
                value={formData.password}
                onChange={(e) => handleInputChange('password', e.target.value)}
                placeholder="Enter your password"
                className="w-full"
                required
                feedback={false}
                toggleMask
              />
            </div>
            <div className="field-checkbox">
              <Checkbox
                inputId="rememberMe"
                checked={formData.rememberMe}
                onChange={(e) => handleInputChange('rememberMe', e.checked)}
              />
              <label htmlFor="rememberMe" className="checkbox-label">
                Remember me
              </label>
            </div>
            <Button
              type="submit"
              label="Sign In"
              icon="pi pi-sign-in"
              loading={loading}
              className="login-button"
            />
          </form>
          <Divider />
          <div className="login-footer">
            <p>Don't have an account?</p>
            <Button
              label="Create Account"
              link
              className="p-button-sm"
            />
          </div>
          <div className="forgot-password">
            <Button
              label="Forgot Password?"
              link
              className="p-button-sm"
            />
          </div>
        </Card>
      </div>
    </div>
  );
}

export default App;
